import React from 'react';

const List = (props) => {

    return (
      <>
        {props.people.map(person => {
      return (
        <article key={props.people.id} className="person">
          <img src={person.image} />
          <div>
            <h3>{person.name}</h3>
            <p>{person.age} years</p>
          </div>

      </article>
      )})}
      </>
    )
};

export default List;
